var $bm_rt;
var damping, elasticity, speedLimit, bounce, tempsClefProx, tempsDebut, tempsDebut, temps, spring, spring;
var fx = effect('Transform Spring');
damping = fx(2).value;
elasticity = fx(1).value;
speedLimit = 0.1;
bounce = fx(3).value;
var result = value;
if (numKeys > 1 && elasticity != 0 && nearestKey(time).index != 1 && length(velocity) <= speedLimit) {
    tempsClefProx = nearestKey(time).time;
    if (tempsClefProx <= time) {
        tempsDebut = tempsClefProx;
    } else {
        tempsDebut = key(sub(nearestKey(time).index, 1)).time;
    }
    temps = sub(time, tempsDebut);
    spring = mul(velocityAtTime(sub(tempsDebut, thisComp.frameDuration)), div(mul(div(0.15, elasticity), Math.sin(mul(mul(mul(elasticity, temps), 2), Math.PI))), Math.exp(mul(temps, damping))));
    if (speedLimit > 0)
        spring = mul(spring, sub(1, div(length(velocity), speedLimit)));
    if (!bounce)
        result = sum(valueAtTime(tempsDebut), spring);
    if (bounce && valueAtTime(tempsDebut - thisComp.frameDuration) > valueAtTime(tempsDebut))
        result = sum(valueAtTime(tempsDebut), Math.abs(spring));
    if (bounce && valueAtTime(tempsDebut - thisComp.frameDuration) < valueAtTime(tempsDebut))
        result = sub(valueAtTime(tempsDebut), Math.abs(spring));
}
$bm_rt = result;

